            Hello, <br />I'm a FullStack Developer.
          </h1>
          <dotlottie-player
            src="https://lottie.host/a005ed5c-8dbf-48e6-85c2-5bb15a008098/gBEwRZChYc.json"
            background="transparent"
            speed="1"
            style={{ width: '80%', height: '80%' }}
            loop
            autoplay
          ></dotlottie-player>
        </div>
      </div>
    </>
  );
}

export default HelloThere;
